public <V, T extends Param<V>> List<V> getValues(String name, Class<T> klass) {
  List<Param<?>> multiParams = (List<Param<?>>)params.get(name);
  List<V> values = Lists.newArrayList();
  if (multiParams != null) {
    for (Param<?> param : multiParams) {
      V value = ((T) param).value();
      if (value != null) {
        values.add(value);
      }
    }
  }
  return values;
}
